import React, { useState } from "react";
import { FaTrash, FaShoppingCart } from "react-icons/fa";
import Sidebar from "../components/Sidebar";

const MyAds = () => {
  const [sidebarOpen, setSidebarOpen] = useState(true);

  const adsData = [
    {
      id: 1,
      image: "https://via.placeholder.com/90",
      item: "Modern Kitchen",
      date: "Nov-25-2019 , 16:54 pm",
      type: "Sale",
      category: "Apartments",
      price: "$89",
      status: "Active",
    },
    {
      id: 2,
      image: "https://via.placeholder.com/90",
      item: "Villa",
      date: "Nov-22-2019 , 9:18 am",
      type: "Sale",
      category: "Homes",
      price: "$14,000",
      status: "Closed",
    },
    {
      id: 3,
      image: "https://via.placeholder.com/90",
      item: "2BHK Rooms",
      date: "Nov-15-2019 , 12:45 pm",
      type: "Buy",
      category: "RealEstate",
      price: "$22,765",
      status: "Sold",
    },
    {
      id: 4,
      image: "https://via.placeholder.com/90",
      item: "Luxury Rooms",
      date: "Nov-03-2019 , 12:50 pm",
      type: "Sale",
      category: "Deluxe Houses",
      price: "$35,978",
      status: "Inactive",
    },
  ];

  const statusColors = {
    Active: "bg-green-500 text-white border-green-700",
    Closed: "bg-red-600 text-white border-red-700",
    Sold: "bg-blue-600 text-white border-blue-700",
    Inactive: "bg-gray-500 text-white border-gray-700",
  };

  return (
    <div className="min-h-screen bg-[#0A0F18] flex">

      {/* LEFT SIDEBAR */}
      <Sidebar sidebarOpen={sidebarOpen} setSidebarOpen={setSidebarOpen} />

      {/* RIGHT CONTENT */}
      <div className="flex-1 p-8 md:ml-80">
        <div className="bg-[#1A2A3A] shadow-xl rounded-xl p-8 text-white">

          {/* TITLE */}
          <h2 className="text-3xl font-semibold mb-6">My Ads</h2>

          {/* TABLE */}
          <div className="overflow-x-auto">
            <table className="w-full border border-gray-700 table-auto">

              {/* TABLE HEAD */}
              <thead className="bg-[#14203B] text-gray-300 uppercase text-xs">
                <tr>
                  <th className="p-4 border border-gray-700">‚†Ä</th>
                  <th className="p-4 border border-gray-700 text-left">Item</th>
                  <th className="p-4 border border-gray-700 text-left">Category</th>
                  <th className="p-4 border border-gray-700 text-left">Price</th>
                  <th className="p-4 border border-gray-700 text-left">Status</th>
                  <th className="p-4 border border-gray-700 text-left">Actions</th>
                </tr>
              </thead>

              {/* TABLE BODY */}
              <tbody>
                {adsData.map((ad) => (
                  <tr key={ad.id} className="bg-[#1D2B3A] border border-gray-700 hover:bg-[#23384E]">

                    {/* CHECKBOX */}
                    <td className="p-4 border border-gray-700">
                      <input type="checkbox" className="w-4 h-4" />
                    </td>

                    {/* ITEM COLUMN */}
                    <td className="p-4 border border-gray-700">
                      <div className="flex gap-4 items-center">
                        <img
                          src={ad.image}
                          alt={ad.item}
                          className="w-16 h-16 object-cover rounded-lg border border-gray-600"
                        />
                        <div>
                          <h3 className="font-semibold">{ad.item}</h3>
                          <div className="text-sm text-gray-400 mt-1">
                            <p>‚è∞ {ad.date}</p>
                            <p>üè∑ {ad.type}</p>
                          </div>
                        </div>
                      </div>
                    </td>

                    {/* CATEGORY */}
                    <td className="p-4 border border-gray-700">{ad.category}</td>

                    {/* PRICE */}
                    <td className="p-4 border border-gray-700 font-bold">{ad.price}</td>

                    {/* STATUS BADGE */}
                    <td className="p-4 border border-gray-700">
                      <span
                        className={`px-3 py-1 rounded-md text-xs font-semibold border ${statusColors[ad.status]}`}
                      >
                        {ad.status}
                      </span>
                    </td>

                    {/* ACTION ICONS */}
                    <td className="p-4 border border-gray-700">
                      <div className="flex gap-3">
                        <button className="bg-red-500 hover:bg-red-600 p-2 rounded-md transition-all duration-200">
                          <FaTrash color="white" size={14} />
                        </button>

                        <button className="bg-blue-500 hover:bg-blue-600 p-2 rounded-md transition-all duration-200">
                          <FaShoppingCart color="white" size={14} />
                        </button>
                      </div>
                    </td>

                  </tr>
                ))}
              </tbody>

            </table>
          </div>

        </div>
      </div>

    </div>
  );
};

export default MyAds;
